import React from "react";
import "./Shop.css";
import { Link } from "react-router-dom";
import axios from "axios";
function Shop() {
  return (
    <form className="shop">
      <div>
        <h1>List of Categories</h1>
        <Link to="/about">
          <button className="click">+</button>
        </Link>
      </div>
    </form>
  );
}

export default Shop;
